import React from "react";
import "./AdventureMap.css"; // Custom CSS for styling
import { Link } from "react-router-dom";

const levels = [
  {
    id: 1,
    name: "Forest Jump",
    task: "Complete 10 Jumps",
    status: "completed",
    icon: "üå≤",
  },
  {
    id: 2,
    name: "Mountain Push-Up",
    task: "Do 10 Push-Ups",
    status: "unlocked",
    icon: "‚õ∞Ô∏è",
  },
  {
    id: 3,
    name: "Desert Squat",
    task: "15 Squats",
    status: "locked",
    icon: "üèúÔ∏è",
  },
  {
    id: 4,
    name: "Icy Plank",
    task: "30s Plank",
    status: "locked",
    icon: "‚ùÑÔ∏è",
  },
  {
    id: 5,
    name: "Crystal Temple",
    task: "Combo Workout",
    status: "locked",
    icon: "üèØ",
  },
];

function AdventureMap() {
  return (
    <div className="adventure-map-container">
      <h1 className="title">üèÅ Adventure Fitness Map</h1>
      <div className="map-path">
        {levels.map((level, index) => (
          <div key={level.id} className={`map-node ${level.status}`}>
            <div className="icon">{level.icon}</div>
            <div className="details">
              <h3>{level.name}</h3>
              <p>{level.task}</p>
              {level.status !== "locked" && (
                <Link
                  to={`/liveworkout?type=${level.name.toLowerCase()}`}
                  className="start-btn"
                >
                  Start
                </Link>
              )}
              {level.status === "locked" && (
                <button className="locked-btn" disabled>
                  Locked üîí
                </button>
              )}
            </div>
            {index < levels.length - 1 && <div className="map-line" />}
          </div>
        ))}
      </div>
    </div>
  );
}

export default AdventureMap;
